window.bookSummaryJSON = "<p><b>All she wants is her freedom…</b></p> <p>Princess Camilla Fitzcharles is willing to risk everything to escape the gilded cage of her life. She’s secured an invitation to participate in the Wild Hunt, a deadly game hosted annually on the secretive Island of Ys. This year’s prize is the one thing that can set her free. Cami just has to survive long enough to win it.</p> <p><b>He’ll do anything to get his revenge…</b></p> <p>Luca has spent the last fifteen years waiting for vengeance. Now the plans are in motion, and there’s no going back. He couldn’t have anticipated Cami, though. She’s an innocent, a reminder of the life that was stolen from him, something to be protected, not leveraged in this dangerous game.</p> <p><b>Getting what they want might cost them everything…</b></p> <p>This year the Wild Hunt has changed. For the first time since its inception, an outsider is named the White Stag, the prey the rest of them hunt—Cami. She’s on the run and in danger, and Luca will do anything to keep her safe. The person she needs the most protection from? Him.</p>"; 
